import React from 'react';
import './Narrativa.css';

const Narrativa = () => {
    return (
        <div className="app-container">
            <div
                className="background"
                style={{ backgroundImage: `url('/images/background.png')` }}
            ></div>
            <div className="text">NARRATIVA</div>
        </div>
    );
};

export default Narrativa;
